selector_to_html = {"a[href=\"glcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Basic code for 1D problems<a class=\"headerlink\" href=\"#basic-code-for-1d-problems\" title=\"Permalink to this heading\">#</a></h1><h2>Basic usage<a class=\"headerlink\" href=\"#basic-usage\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"bib.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Bibliography<a class=\"headerlink\" href=\"#bibliography\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"domain.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Domain walls<a class=\"headerlink\" href=\"#domain-walls\" title=\"Permalink to this heading\">#</a></h1><h2>Plots with varying <span class=\"math notranslate nohighlight\">\\(\\kappa\\)</span><a class=\"headerlink\" href=\"#plots-with-varying-kappa\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"meissner.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Meissner effect in 1D<a class=\"headerlink\" href=\"#meissner-effect-in-1d\" title=\"Permalink to this heading\">#</a></h1><p>Programs to solve the GL BVP with an applied field <span class=\"math notranslate nohighlight\">\\(b_0\\)</span> at <span class=\"math notranslate nohighlight\">\\(x=0\\)</span> of half infinite superconductor in region x&gt;0.</p><p>I hope the plots below demonstrate the sort of range of behaviors. You can play with them if you click on the rocket icon at the top and select \u201cLive code\u201d. You need to wait for the gray box above to report that the kernel is ready. The hidden code below with some initialization should automatically execute, but may add some extra delay. The status of this process can be seen by clicking on the triangle next to \u201cShow code cell source\u201d.</p>", "a[href=\"vortex.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Vortex solutions<a class=\"headerlink\" href=\"#vortex-solutions\" title=\"Permalink to this heading\">#</a></h1><p>We have set the boundary conditions so that the differential system does not blow up as the r limits tend to zero and infinity. The magnetic flux should be constant. One needs to remember the area is cylindrically symmetric, and given by:</p>", "a[href=\"gibbs.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Gibbs free energy<a class=\"headerlink\" href=\"#gibbs-free-energy\" title=\"Permalink to this heading\">#</a></h1><h2>Critical applied magnetic field<a class=\"headerlink\" href=\"#critical-applied-magnetic-field\" title=\"Permalink to this heading\">#</a></h2><p>There is no possibility of coexistence of a magnetic field with a constant non-zero order parameter \u2014 the two fields have to interact and come to a non-constant compromise over a distance of order <span class=\"math notranslate nohighlight\">\\(\\lambda_L\\)</span>. The (free) energy density of a constant magnetic field is <span class=\"math notranslate nohighlight\">\\(\\mathbf B^2/8\\pi\\)</span>.</p><p>Maxwell\u2019s equations in matter are traditionally posed in terms of applied fields <span class=\"math notranslate nohighlight\">\\(\\mathbf{H,D}\\)</span>, and local fields, <span class=\"math notranslate nohighlight\">\\(\\mathbf{B,E}\\)</span>, that are the response to the applied fields. Concentrating on the magnetic behaviour, the differential of the free energy density <span class=\"math notranslate nohighlight\">\\(f\\)</span> is composed as:</p>", "a[href=\"current.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Current<a class=\"headerlink\" href=\"#current\" title=\"Permalink to this heading\">#</a></h1><p>We remember that:</p>", "a[href=\"flux.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Flux<a class=\"headerlink\" href=\"#flux\" title=\"Permalink to this heading\">#</a></h1><p>In the London theory, the magnetic flux is quantized in units of <span class=\"math notranslate nohighlight\">\\(\\phi_L=hc/e^*\\)</span>.</p>", "a[href=\"abbreviations.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Abbreviations<a class=\"headerlink\" href=\"#abbreviations\" title=\"Permalink to this heading\">#</a></h1><p>{G-L}=\n##Ginzburg-Landau</p>", "a[href=\"film.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Thin films<a class=\"headerlink\" href=\"#thin-films\" title=\"Permalink to this heading\">#</a></h1><p>We use the GL code to allow two surfaces as boundaries.</p>", "a[href=\"scaling.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scaling the equations<a class=\"headerlink\" href=\"#scaling-the-equations\" title=\"Permalink to this heading\">#</a></h1><p>We have two length scales:</p>", "a[href=\"bib.html#id2\"]": "<dt class=\"label\" id=\"id2\"><span class=\"brackets\">ArovasWu19</span></dt><dd><p>Daniel Arovas and Congjun Wu. Lecture notes on superconductivity (a work in progress). 2019. URL: <a class=\"reference external\" href=\"https://courses.physics.ucsd.edu/2014/Spring/physics239/LECTURES/SUPERCONDUCTIVITY.pdf\">https://courses.physics.ucsd.edu/2014/Spring/physics239/LECTURES/SUPERCONDUCTIVITY.pdf</a>.</p></dd>", "a[href=\"#ginzburg-landau-and-scipy\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ginzburg-Landau and scipy<a class=\"headerlink\" href=\"#ginzburg-landau-and-scipy\" title=\"Permalink to this heading\">#</a></h1><p>The plan here is to see how to put stuff on my website that enables python calculations in as simple a way as possible. I make heavy use of <span id=\"id1\">[<a class=\"reference internal\" href=\"bib.html#id2\" title=\"Daniel Arovas and Congjun Wu. Lecture notes on superconductivity (a work in progress). 2019. URL: https://courses.physics.ucsd.edu/2014/Spring/physics239/LECTURES/SUPERCONDUCTIVITY.pdf.\">ArovasWu19</a>]</span>.</p>", "a[href=\"free.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Ginzburg-Landau free energy<a class=\"headerlink\" href=\"#ginzburg-landau-free-energy\" title=\"Permalink to this heading\">#</a></h1><p>A gauge-invariant free energy with order parameter <span class=\"math notranslate nohighlight\">\\(\\Psi\\propto \\left&lt;\\psi_\\downarrow(\\mathbf x)\\psi_\\uparrow(\\mathbf x)\\right&gt;\\)</span> has the form:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
